	<script type="text/javascript">
		//alert(typeof document.getElementsByClassName);
		DOMAssistant.DOMReady(function () {
			/*$("td").each(function () {
				$(this).load("ajax.html");
			});*/
			
			try{
				$("#container").create("h1", null, true, "Monkeys").addContent(" like bananas").addClass("focused");
				$$("container").create("h1", null, true, "One").addContent(" more time").addClass("focused");
				$("td").create("h1", null, true, "Hippos").addContent(" have huge teeth").addClass("focused");
				
				//$("td").addContent($(document).create("h1")).addContent("Apa");
				//alert($("td").addContent($("td").create("h1", null, true, "Apa")));
			}
			catch(e){
				alert(e);
			}
			
			//alert($("div#aaa.ccc"));
			//$("div#aaa.ccc").style.background = "red";
			
			
			$('div.我 p:first-child)').each( function()
			{ this.style.backgroundColor = 'blue'; });
			$('#中文 #大').each( function() { this.style.backgroundColor = 'red'; });
			$('#中文.我 .小[title=他]').each( function() { this.style.backgroundColor =
			'green'; });
			$$('妖').style.backgroundColor = 'yellow';
			
			
			//$("td").addContent($("td").create("h1", null, true)).addContent("Hej");
			//$("#container").get("ajax.html", func);
			//$$("container").get("ajax.html", func);
		});
		function func (response) {
			this.innerHTML = response;
			//setTimeout("alert(DOMAssistant.AJAX.getReadyState())", 500);
		}

		.focused{
